text:
Добро пожаловать в *_#library_ — канал-библиотеку*. Тут мы делимся дополнительными тематическими материалами: статьями, ссылками на учебники и полезные книги, плейлистами в youtube и т.д.

Здесь не нужно говорить шепотом, и возвращать книги в срок, но несколько правил есть:

• Нажимаем Shift + Enter, чтобы сделать новую строчку в сообщении (и не писать несколько сообщений по одному слову);
• Пользуемся тредами, чтобы обсудить классную ссылку в канале;
• Не сливаем сюда файлы книг — без разрешения от правообладателя это не очень законно;
• Друг друга не обижаем, здесь атмосфера мира, дружбы и жвачки;
• Смело делимся полезной информацией.

Мы советуем к каждой ссылке добавить описание, о чём это / почему это круто, а также отмечать смайликами понравившиеся ресурсы.

Всем век живи — век учись!
